import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  Container,
  TextField,
  Button,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Paper,
} from "@mui/material";

const PropertyManager = () => {
  const [properties, setProperties] = useState([]);
  const [formData, setFormData] = useState({
    name: "",
    address: "",
    size: "",
    price: "",
    status: "",
  });
  const [images, setImages] = useState([]);

  // Load all properties
  const fetchProperties = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/property");
      setProperties(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchProperties();
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setImages(e.target.files);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData();
    data.append("name", formData.name);
    data.append("address", formData.address);
    data.append("size", formData.size);
    data.append("price", formData.price);
    data.append("status", formData.status);

    for (let i = 0; i < images.length; i++) {
      data.append("images", images[i]);
    }

    try {
      await axios.post("http://localhost:5000/api/property", data, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      setFormData({ name: "", address: "", size: "", price: "", status: "" });
      setImages([]);
      fetchProperties(); // refresh table
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <Container>
      <h1>Property Manager</h1>

      {/* Property Form */}
      <form onSubmit={handleSubmit} style={{ marginBottom: "2rem" }}>
        <TextField
          label="Name"
          name="name"
          value={formData.name}
          onChange={handleChange}
          fullWidth
          margin="normal"
        />
        <TextField
          label="Address"
          name="address"
          value={formData.address}
          onChange={handleChange}
          fullWidth
          margin="normal"
        />
        <TextField
          label="Size"
          name="size"
          value={formData.size}
          onChange={handleChange}
          fullWidth
          margin="normal"
        />
        <TextField
          label="Price"
          name="price"
          value={formData.price}
          onChange={handleChange}
          fullWidth
          margin="normal"
        />
        <TextField
          label="Status"
          name="status"
          value={formData.status}
          onChange={handleChange}
          fullWidth
          margin="normal"
        />
        <input
          type="file"
          multiple
          accept="image/*"
          onChange={handleFileChange}
          style={{ margin: "10px 0" }}
        />
        <Button type="submit" variant="contained" color="primary">
          Add Property
        </Button>
      </form>

      {/* Properties Table */}
      <Paper>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Property ID</TableCell>
              <TableCell>Name</TableCell>
              <TableCell>Address</TableCell>
              <TableCell>Size</TableCell>
              <TableCell>Price</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Images</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {properties.map((prop) => (
              <TableRow key={prop._id}>
                <TableCell>{prop.PropertyId}</TableCell>
                <TableCell>{prop.name}</TableCell>
                <TableCell>{prop.address}</TableCell>
                <TableCell>{prop.size}</TableCell>
                <TableCell>{prop.price}</TableCell>
                <TableCell>{prop.status}</TableCell>
                <TableCell>
                  {prop.images?.map((img, idx) => (
                    <img
                      key={idx}
                      src={img}
                      alt="Property"
                      width={50}
                      style={{ marginRight: 5 }}
                    />
                  ))}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </Container>
  );
};

export default PropertyManager;
